import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using attribute selector (different from previous attempts)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type a partial query to trigger autocomplete (e.g., "iph")
    await page.fill('input[placeholder="Search Amazon"]', 'iph');

    // Wait for the suggestions dropdown using its class (search-suggestions)
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions.png'));

    // Extract suggestion texts using textContent of .suggestion-item
    const suggestions = await page.$$eval('.suggestion-item', items =>
      items.map(el => el.textContent.trim())
    );

    // Click the first suggestion using nth selector
    if (suggestions.length > 0) {
      await page.click('.suggestion-item:nth-child(1)');
    }

    // Wait for the search results heading to appear (using text selector)
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_results.png'));

    // Extract the heading text and number of results
    const heading = await page.textContent('h2:has-text("Search Results")');
    const resultsCount = await page.textContent('.results-count');

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected one, and verified search results.",
      extractedData: {
        suggestions,
        heading: heading ? heading.trim() : '',
        resultsCount: resultsCount ? resultsCount.trim() : ''
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
